import React, { Component } from 'react'

export default class Tournaments extends Component {

    constructor(props){
        super(props);
        this.state={tournaments:[]}
    }

    componentWillMount(){
        const url = "http://www.localhost:8000/tennis/";
        fetch(url)
        .then(res => {res.json()})
        .then(res => {this.setState({...this.state,tournaments:res})});
        console.log(""+this.state.tournaments);
    }


    render() {

        return (
            <div>
                {this.state.tournaments.map(tournament => {
                    return <div>{tournament.event_name}</div>
                })
                }

            </div>
        )
    }
}
